import React from 'react'

const SchoolData = (props) => {
    return (
        <div>
            <h1>School Data</h1>
            <label>Please select your school:</label>
            <select>
                {SchoolData.schools.map(index => {
                <div>
                    <h1>test Div</h1>

                </div>

                })}
            


            </select>
            
        </div>
    )
}

export default SchoolData
